import logo from './logo.svg';
import './App.css';
import {Mainchara, Nagisa} from'./animal';
import {introduce} from'./introduce';
import {hoge} from'./introduce'
function App() {
  const shinji = new Mainchara('shinji','male','evashogokipilot')  
  const ayanami = new Mainchara('ayamani','female','evazerogokipilot')
  const nagisa = new Nagisa('kaoru','male','13shito')

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>{shinji.introduce()}</p>
        <p>{shinji.batou()}</p>
        <p>{ayanami.introduce()}</p>
        <p>{ayanami.batou()}</p>
        <p>{nagisa.introduce()}</p>
        <p>{nagisa.loop(3)}</p>
        <p>{nagisa.loop(4)}</p>
        <p>{introduce('shinji', 'evashogokipilot')}</p>
        <p>{introduce('ayanami', 'evazerogokipilot')}</p>

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
